axes[1].plot(history.history['val_loss'], label='Validation')
axes[1].set_title('Model Loss')
axes[1].set_xlabel('Epoch')
axes[1].set_ylabel('Loss')
axes[1].legend()
axes[1].grid(True, alpha=0.3)

plt.tight_layout()
plt.show()

# Print metrics
print(f"Final training accuracy: {history.history['accuracy'][-1]:.4f}")
print(f"Final validation accuracy: {history.history['val_accuracy'][-1]:.4f}")
print(f"Best validation accuracy: {max(history.history['val_accuracy']):.4f}")

"""### Evaluate on Test Set"""

# Load best model
best_model = keras.models.load_model('best_genre_classifier.keras')

# Evaluate
test_loss, test_accuracy = best_model.evaluate(X_test, y_test_cat, verbose=0)
print(f"Test Accuracy: {test_accuracy:.4f} ({test_accuracy*100:.2f}%)")
print(f"Test Loss: {test_loss:.4f}")

# Get predictions
y_pred = np.argmax(best_model.predict(X_test, verbose=0), axis=1)

# Classification report
print("\nClassification Report:")
print(classification_report(y_test, y_pred, target_names=label_encoder.classes_))

# Confusion matrix
cm = confusion_matrix(y_test, y_pred)

fig, axes = plt.subplots(1, 2, figsize=(18, 7))

# Absolute counts
sns.heatmap(cm, annot=True, fmt='d', cmap='Blues', xticklabels=label_encoder.classes_,
            yticklabels=label_encoder.classes_, ax=axes[0])
axes[0].set_title('Confusion Matrix (Counts)')
axes[0].set_xlabel('Predicted')
axes[0].set_ylabel('True')

# Normalized
cm_norm = cm.astype('float') / cm.sum(axis=1)[:, np.newaxis]
sns.heatmap(cm_norm, annot=True, fmt='.2%', cmap='YlOrRd', xticklabels=label_encoder.classes_,
            yticklabels=label_encoder.classes_, ax=axes[1])
axes[1].set_title('Confusion Matrix (Normalized)')
axes[1].set_xlabel('Predicted')
axes[1].set_ylabel('True')

plt.tight_layout()
plt.show()

# Per-genre accuracy
class_acc = cm.diagonal() / cm.sum(axis=1)
print("\nPer-Genre Accuracy:")
for genre, acc in zip(label_encoder.classes_, class_acc):
    print(f"  {genre:12s}: {acc:.2%}")

"""### Visualize Sample Predictions"""

# Select random samples
indices = np.random.choice(len(X_test), 9, replace=False)

fig, axes = plt.subplots(3, 3, figsize=(18, 15))
fig.suptitle('Sample Predictions', fontsize=16, fontweight='bold')

for idx, ax in enumerate(axes.flat):
    sample_idx = indices[idx]
