    true_label = y_test[sample_idx]

    pred_probs = best_model.predict(sample[np.newaxis, ...], verbose=0)[0]
    pred_label = np.argmax(pred_probs)
    confidence = pred_probs[pred_label]

    true_genre = label_encoder.classes_[true_label]
    pred_genre = label_encoder.classes_[pred_label]
    is_correct = true_label == pred_label

    # Plot spectrogram
    librosa.display.specshow(sample[:, :, 0], sr=SAMPLE_RATE, hop_length=HOP_LENGTH,
                            x_axis='time', y_axis='mel', ax=ax, cmap='viridis')

    color = 'green' if is_correct else 'red'
    symbol = '✓' if is_correct else '✗'
    ax.set_title(f"{symbol} True: {true_genre}\nPred: {pred_genre} ({confidence:.1%})",
                fontsize=10, color=color, fontweight='bold')

